import React, { useEffect, useState } from "react";
import ProdutosList from "./ProdutosList";
import Loading from "./Loading";

import { Container, Centralize, socialNetwork,
    Social,
    FacebookIcon,
    LinkedinIcon,
    GitHubIcon, } from "./styles/ProdutosApiStyle";

export default function ProdutosApi() {
    const [produto, setProduto] = useState([]);

    useEffect(() => {
        async function fetchProdutos(url) {
            const response = await fetch(url);
            const data = await response.json();

            setProduto(data);
        }
        fetchProdutos(
            "http://makeup-api.herokuapp.com/api/v1/products.json?brand=covergirl&product"
        );
    }, []);

    return (
        <Container>
            <Centralize>
                <h2>Produtos</h2>
            </Centralize>
            <socialNetwork>
                ahjjjjjjjjjj
                ahjjjjjjjjjj
                ahjjjjjjjjjj
                ahjjjjjjjjjj
    padding: 5px;
                ahjjjjjjjjjj
                <Social>
                    <FacebookIcon />
                    <a href="https://www.facebook.com/marcos.proenca.186/"></a>
                </Social>
                <Social>
                    <LinkedinIcon />
                    <a href="https://www.linkedin.com/in/marcos-proença-5820101b1/"></a>
                </Social>
                <Social>
                    <GitHubIcon />
                    <a href="https://github.com/MarcosPProgramador"></a>
                </Social>

            </socialNetwork>
            {produto.length ? <ProdutosList produtos={produto} /> : <Loading />}
        </Container>
    );
}
